import React, { useState, useEffect } from 'react';
import axios from "axios"
import swal from 'sweetalert';

import './Member.css';
import Navbar from '../../componets/Navbar/Navbar'
import Footer from '../../componets/Footer/Footer'
import toast from 'react-hot-toast';

function Member() {
    const [months, setMonths] = useState("Select Months");
    const [paymentMode, setPaymentMode] = useState('');
    const [user, setUser] = useState('')

    const [uname, setUname] = useState("");
    const [age, setAge] = useState("");
    const [email, setEmail] = useState("");
    const [number, setNumber] = useState("");
    const [totalAmount, setTotal] = useState(0);
    const [mode, setMode] = useState("");
    const [status] = useState("Not Yet")
   

    const [canProceed, setCanProceed] = useState(false);

    const handleMonthChange = (e) => {
        const selectedMonth = e.target.value;
        setMonths(selectedMonth);

        switch (selectedMonth) {
            case '1 Month':
                setTotal("500");
                break;
            case '2 Months':
                setTotal("800");
                break;
            case '1 Year':
                setTotal("4500");
                break;
            default:
                setTotal("");
                break;
        }
    };

    const handlePaymentModeChange = (e) => {
        setPaymentMode(e.target.value);
        setMode(e.target.value)
    };


    useEffect(() => {
        const currentUser = JSON.parse(localStorage.getItem('currentUser'))

        if (currentUser) {
            setUser(currentUser)
        }

        if (!currentUser) {
            window.location.href = '/login'
        }
    }, [])

    const addMember = async () => {
        const response = await axios.post(`${process.env.REACT_APP_API_URL}/member`, {
            uname,
            age,
            email,
            number,
            months,
            totalAmount,
            mode,
            status,
            user: user._id
        })

        if (response.data.success) {
            // toast.success(response.data.message);
            swal({
                title: "Thank You!",
                text: "Trainer will response you as soon as posiible!",
                icon: "success",
                // button: "ok",
              })
            .then(()=>  {
                setUname("")
                setAge('')
                setEmail('')
                setNumber('')
                setMonths('Select Months')
                // setAmount(0)
                setTotal(0)
    
                setTimeout(() => {
                    window.location.href = '/'
                }, 1000)
            });        

        } else {
            // toast.error("Sorry, Email already Exist...");
            swal("Sorry, Email already Exist...",{
                dangerMode : true
            });
        }
    }

    const handleProceed = () => {
        const name = document.getElementById('name').value;
        const age = document.getElementById('age').value;
        const email = document.getElementById('email').value;
        const mobile = document.getElementById('mobile').value;
        // const file = document.getElementById('file').value;



        if (!name || !age || !email || !mobile || months === "Select Months" || !mode) {
            toast.error("Please Enter all deatils")
            return
        }



        const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
        const pattern = /^[6-9]\d{9}$/;

        if (!emailRegex.test(email)) {
            toast.error("Please Enter Valid email address");
            return;
        }
        if (!pattern.test(mobile)) {
            toast.error("Please Enter Valid Mobile Number");
            return;
        }

        // const check = addMember();
        // addMember();   

        if (mode === 'offline') {
            if(totalAmount===0){
                toast.error("Please, Enter Amount")
                return
            }
            addMember();
            // setStatus("Not Yet")
        }

        if (mode === 'online') {
            if (canProceed === 'Yes') {
                if(totalAmount===0){
                    toast.error("Please, Enter Amount")
                    return
                }
                addMember();
                // setStatus("Not Yet")
            }
            else {
                if(totalAmount === 0){
                    toast.error("Please, Enter Amount")
                    return
                }
                toast.error("Please, Share Your Receipt")
            }
        }


    };

    return (
        <>
            <Navbar />

            <div className="form-container">
                <div className="form-items form-dark-bg" id="form">
                    <form>
                        <h2>Become a Member Today</h2>
                        <div className="content">
                            <div className="input-box">
                                <label htmlFor="name">Full Name</label>
                                <input
                                    type="text"
                                    id="name"
                                    placeholder="Enter Your Name"
                                    value={uname}
                                    onChange={(e) => setUname(e.target.value)}
                                    required />
                            </div>
                            <div className="input-box">
                                <label htmlFor="age">Age</label>
                                <input type="number" id="age"
                                    placeholder="Enter Your Age"
                                    value={age}
                                    onChange={(e) => setAge(e.target.value)}
                                    required />
                            </div>
                            <div className="input-box">
                                <label htmlFor="email">Email</label>
                                <input type="email" placeholder="Enter your Email" id="email"
                                    value={email}
                                    onChange={(e) => setEmail(e.target.value)}
                                    required />
                            </div>
                            <div className="input-box">
                                <label htmlFor="mobile">Mobile Number</label>
                                <input type="text" placeholder="Enter Your Mobile Number" id="mobile"
                                    value={number}
                                    onChange={(e) => setNumber(e.target.value)}
                                    required />
                            </div>
                            <div className="input-box">
                                <label htmlFor="months">Months</label>
                                <select
                                    name="months"
                                    id="months"
                                    value={months}
                                    onChange={handleMonthChange}>
                                    <option>Select Months</option>
                                    <option>1 Month</option>
                                    <option>2 Months</option>
                                    <option>1 Year</option>
                                </select>
                            </div>
                            <div className="input-box">
                                <label htmlFor="amount">Total Amount</label>
                                <input type="number" placeholder="Total" id="amount" value={totalAmount} onChange={(e) => setTotal(e.target.value)} required />
                            </div>
                            <div className="input-box">
                                <label htmlFor="mode">Payment Mode</label>
                                <div className="mode">
                                    <input type="radio" name="mode" value="online" id="online" checked={paymentMode === 'online'} onChange={handlePaymentModeChange} />
                                    <label htmlFor="online">Online</label>
                                    <input type="radio" name="mode" value="offline" id="offline" checked={paymentMode === 'offline'} onChange={handlePaymentModeChange} />
                                    <label htmlFor="offline">Offline</label>
                                </div>
                            </div>
                            <div className="input-box payment">
                                {paymentMode === 'online' && (
                                    <>
                                        <a href='data:image/jpeg;base64,'
                                            download="scanner.jpg"
                                            className='share-receipt'>
                                            Download Scanner
                                        </a>
                                    </>
                                )}
                            </div>

                            {paymentMode === 'online' && (
                                <>
                                    <div className="input-box">
                                        <p>Share Receipt on <a href='tel: 7028112938' className='share-receipt'>7028112938</a></p>
                                    </div>
                                    <div className="input-box">
                                        <div className="mode">
                                            <input type="radio" name="done" value="Yes"
                                                onChange={(e) => setCanProceed(e.target.value)} id="Yes" />
                                            <label htmlFor="Yes">Yes</label>
                                            <input type="radio" name="done" value="No"
                                                onChange={(e) => setCanProceed(e.target.value)} id="No" />
                                            <label htmlFor="No">No</label>
                                        </div>
                                    </div>
                                </>
                            )}



                        </div>

                        <div className="btn-container">
                            <button type="button" className="btn" onClick={handleProceed} >Proceed</button>
                            <button type="reset" className="btn">Cancel</button>
                        </div>
                    </form>
                </div>
            </div>

            <Footer />
        </>
    );
}

export default Member;

